--
-- Bẫy `users`
--
DELIMITER $$
CREATE TRIGGER `trg_users_prevent_zero_admin_delete` BEFORE DELETE ON `users` FOR EACH ROW BEGIN
  DECLARE v_admin_role_id INT;
  DECLARE v_admin_count   INT;

  SELECT id INTO v_admin_role_id
  FROM roles
  WHERE role_code = 'ADMIN'
  LIMIT 1;

  IF OLD.role_id = v_admin_role_id THEN
     SELECT COUNT(*) INTO v_admin_count
     FROM users
     WHERE role_id = v_admin_role_id;

     IF v_admin_count <= 1 THEN
        SIGNAL SQLSTATE '45000'
          SET MESSAGE_TEXT = 'Hệ thống phải có ít nhất 1 Admin. Không thể xóa Admin cuối cùng.';
     END IF;
  END IF;
END
$$
DELIMITER ;
DELIMITER $$
CREATE TRIGGER `trg_users_prevent_zero_admin_update` BEFORE UPDATE ON `users` FOR EACH ROW BEGIN
  DECLARE v_admin_role_id INT;
  DECLARE v_admin_count   INT;

  SELECT id INTO v_admin_role_id
  FROM roles
  WHERE role_code = 'ADMIN'
  LIMIT 1;

  -- Nếu user đang là Admin và định chuyển sang role khác (kể cả NULL)
  IF OLD.role_id = v_admin_role_id
     AND (NEW.role_id IS NULL OR NEW.role_id <> v_admin_role_id) THEN

     SELECT COUNT(*) INTO v_admin_count
     FROM users
     WHERE role_id = v_admin_role_id;

     -- Nếu hiện tại chỉ còn đúng 1 Admin (chính người này) => chặn
     IF v_admin_count <= 1 THEN
        SIGNAL SQLSTATE '45000'
          SET MESSAGE_TEXT = 'Hệ thống phải có ít nhất 1 Admin. Không thể hạ cấp Admin cuối cùng.';
     END IF;
  END IF;
END
$$
DELIMITER ;

